--
-- Estructura de tabla para la tabla `establecimientos_salud`
--

CREATE TABLE IF NOT EXISTS `establecimientos_salud` (
	`id_estab` INT PRIMARY KEY AUTO_INCREMENT,
	`cod_asic` INT NOT NULL,
	`id_tipo` INT NOT NULL,
	`cod_parr` INT NOT NULL,
	`nombre` VARCHAR(200) NOT NULL,
	`direccion` VARCHAR(200) DEFAULT NULL,
	`url_foto` VARCHAR(100) DEFAULT NULL,
	`geom` point NOT NULL,
	FOREIGN KEY (cod_parr) REFERENCES parroquias(cod_parr),
	FOREIGN KEY (id_tipo) REFERENCES tipo_establecimientos(id_tipo),
	FOREIGN KEY (cod_asic) REFERENCES asic(cod_asic)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;
 
